import { Component } from 'react'
import './Main.css'

class Main extends Component {
  render() {
    return (
      <main className="main">
        <div className="container">
          <img src={logo} className="App-logo" alt="logo" />
          <nav className="navMenu">
            <a href="#">Home</a>
            <a href="#">Blog</a>
            <a href="#">Work</a>
            <a href="#">About</a>
            <div className="dot"></div>
          </nav>
        </div>
      </main>
    )
  }
}

export { Main }
